import menu from "./menu"
import primaryAction from "./primaryAction"
import theme from "./theme"

export default {
    theme: theme,
    root: "/art",
    siteId: 2,
    collectionId: 183,
    title: "Primus Art",
    subtitle: "Museum",
    menu: menu,
    primaryAction: primaryAction,
    sidebar: {
        expanded: true
    },
    search: {
        "expanded": false,
        "placeholder": "Søk i Primus Art"
    }
}
